import React,{useEffect,useState} from 'react'
import { Route,Routes, Switch} from "react-router-dom";
import Navlink from './Navlink';
import Home from './Home';
import About from './About';
import Service from './Service'; 
import SignIn from './SignIn';
import SignUp from './SignUP'
import Description from './Description';
import '../css/App.css'
import Footer from './Footer';





function App () {


  const [currentUser, setCurrentUser] = useState(null)

  const changeUser = (user) => {
    setCurrentUser(user)
  }

  // Set developer as user , fetch user from database https://9292/developers

  const [developers, setDevelopers] = useState([])

  useEffect(() => {
    fetch('http://localhost:9292/developers')
      .then(response => response.json())
      .then(data => setDevelopers(data))
  }, [])

  return (
    <div>

     < Navlink/>
     < Description/>
     < Footer />
      <Routes>
        <Switch>
        <Route exact='true' path='/' component={<Description />} ></Route>
        <Route exact='true' path='/' element={<Description />} ></Route>
        <Route exact='true' path='/about' element={<About />} ></Route>
        <Route path="/signin" element={<SignIn changeUser={changeUser} />} />
        <Route path="/signup" element={<SignUp />} />      
        {
          developers.map(dev => {
            return <Route key={dev.id} path={`/${dev.id}/service`} element={<Service  />} />
          }
          )
        }
        </Switch>
      </Routes>  
    </div>
  )
}

export default App
